import React from 'react';
import 'tachyons'

const Card = (props) => {
	return(
		<div className="bg-lightest-blue dib br3 pa3 ma2 grow bw2 shadow-5">
			<img alt='robo_photo' src="https://robohash.org/sachu" />
			<div>
				<h2>{props.name}</h2>
				<p>{props.email}</p>
			</div>
		</div>
	);
}

export default Card;
